'''输入一个链表，从尾到头打印链表每个节点的值。'''# -*- coding:utf-8 -*-class ListNode:    def __init__(self, x):        self.val = x        self.next = None        passclass Solution:    # 返回从尾部到头部的列表值序列，例如[1,2,3]    def printListFromTailToHead(self, listNode):        # write code here        stack = []        while listNode != None:            stack.append(listNode.val)            listNode = listNode.next            pass        return stack[::-1]    passif __name__ == '__main__':    '''    测试用例：        * 空链表        * 空指针        * 包含多个元素的链表        * 只有一个元素的链表    '''    # *空链表    test_empty = {}    #  空指针    test_none = None    # *包含多个元素的链表    test_multi_items = ListNode(1)    temp = ListNode(2)    test_multi_items.next = temp    for i in range(3, 6):        temp.next = ListNode(i)        temp = temp.next        pass    # *只有一个元素的链表    test_sigle_item = ListNode(1)    solution = Solution()    solution.printListFromTailToHead(test_empty)